import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import sad from '../assets/sad.png';
import './show-expense.css';

const ShowExpense = () => {
  const navigate = useNavigate();
  const [expenses, setExpenses] = useState([]);
  const [no, setno] = useState("1");


  useEffect(() => {
    const fetchExpenses = async () => {
      try {
        if(no==1){
        const response = await fetch('http://localhost:9000/listExpenses');}

        if (!response.ok) {
          throw new Error('Failed to fetch expenses');
        }     
        const data = await response.json();
        setExpenses(data);
      } catch (error) {
        console.error('Error fetching expenses:', error);
      }
    };

    fetchExpenses();
  }, []);

  // Calculate total expenses
  const totalExpenses = expenses.reduce((total, expense) => total + expense.amount, 0);

  return (
    <div className="mainaddcontainer">
      <div className="addparentnavbar">
        <div className="navcontainer">
          <span className='navspan'>
            <span className="navtext" onClick={() => navigate("/home")}>
              GO TO HOMEPAGE?
            </span>
          </span>
        </div>
        <div className="navcontainer">
          <span className='navspan'>
            <span className="navtext" onClick={() => navigate("/")}>
              Bored? Logout HUMAN 
              <img className='spanimg' src={sad} alt=""/>
            </span>
          </span>
        </div>
      </div>

      <div className='expense-container'>
        <h2 className='expense-heading'>All Expenses</h2>
        {expenses.length === 0 ? (
          <p>No expenses found.</p>
        ) : (
          <>
            <table className='expense-table'>
              <thead>
                <tr>
                  <th>Category</th>
                  <th>Date</th>
                  <th>Amount</th>
                  <th>Description</th>
                </tr>
              </thead>
              <tbody>
                {expenses.map(expense => (
                  <tr key={expense.id} className='expense-row'>
                    <td>{expense.category}</td>
                    <td>{expense.date}</td>
                    <td>Rs {expense.amount}</td>
                    <td>{expense.description}</td>
                  </tr>
                ))}
              </tbody>
            </table>
            <span className='expense-functions'>
              <div className="expense-functions-heading">
                Select what you want to do??
              </div>
              <div className='function'>
                1. Show all expenses??
              </div>
              <div className='function'>
                2. Show expenses by Category??
              </div><div className='function'>
                3. Show expenses by Date??
              </div>
              <div className='function'>
                4. Show expenses by Highest amount??
              </div>
              <div className='function'>
                5. Show  expenses by Lowest amount??
              </div>
              <div className='function'>
                6. Edit or remove an expense??
              </div>
            </span>
            <div className="total-expenses">
              <p>Total Expenses: Rs {totalExpenses}</p>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default ShowExpense;
